import data from './data'
import './App.css';

function App() {
  return (
    <div >
      <header>
        <main>
          <p>List Products</p>
          <h1>Featured Products</h1>
          {
            data.products.map(product => (
              <div key={product.pid} >
                <img src={product.image} />
                <p>{product.name}</p>
              </div>
            ))
          }
        </main>


      </header>
    </div>
  );
}

export default App;
